import { Box } from '@mui/material'
import React from 'react'
import ImageCarousel from './ImageCarousel'
import HighlightSection from './HighlightSection';


const Home = () => {
  return (
    <Box >
      <ImageCarousel />
      <HighlightSection />
    </Box>
  )
}

export default Home
